import React from 'react'

function CheckBox (props) {
  const { id, onCheckBox } = props
  const handleCheckBox = id => props.onCheckBox(id)

  return (
    <input type='checkbox' onChange={() => handleCheckBox(props.id)} />
  )
}

export default CheckBox
